import React, { Component } from 'react';

class CreateAssignmentForm extends Component {
    constructor() {
        super()
        this.state
    }
    render() {
        return (
            <form>
                <div className="row">
                    <div className="col">
                        <input
                            onChange=""
                            type="text"
                            value={this.state.name}
                            className="form-control"
                            placeholder="Assignment Name" />
                    </div>
                    <div className="col">

                    </div>
                </div>
            </form>
        );
    }
}

export default CreateAssignmentForm;
